package practice;

import java.util.Scanner;

public class fibonaccies {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
	
	int a=5;
	int b=3;
	int c=0;
	for(int i=1;i<=8;i++)
	{
		c=a+b;
		a=b;
		b=c;
		System.out.print(c+" ");
	}
	
		
		
		
		
		
		
		
		
		
		
		
		
		
	}

}
